Lightly used Ruger Gunsite Scout Rifle; Ruger SKU 6803: .308 Win, right-handed, laminated stock, 16" barrel. Comes with original packaging and metal 10-round magazine. Additionally comes with:
- 3 x 10-round Ruger nylon magazine;
- 1 x 3-round nylon magazine;
- Burris 2.75 x 20mm scout rifle scope;
- Galco black leather Safari Ching sling (not shown in image).

Greatly prefer to sell as a package. Happy to meet at any FFL around the northern half of I-405, Everett to Bellevue. Need to sell for money, sorry.
